  <style>
    body {
      margin: 0;
      background-color: black;
      color: white;
    }
    #player {
      width: 100%;
      height: 100vh;
    }
    #loading {
      position: fixed;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background: linear-gradient(135deg, #000000, #1a1a1a);
      display: flex;
      align-items: center;
      justify-content: center;
      z-index: 9999;
      font-size: 2.5rem;
      font-weight: bold;
      color: #ffffff;
      font-family: 'Poppins', 'Segoe UI', sans-serif;
      animation: fadeIn 1s ease-in-out, pulse 2s infinite, textflow 6s linear infinite;
      text-align: center;
      padding: 20px;
      box-sizing: border-box;
      overflow: hidden;
    }
    @keyframes pulse {
      0% { transform: scale(1); opacity: 1; }
      50% { transform: scale(1.02); opacity: 0.8; }
      100% { transform: scale(1); opacity: 1; }
    }
    @keyframes fadeIn {
      from { opacity: 0; }
      to { opacity: 1; }
    }
    @keyframes textflow {
      0% { color: #ff0000; }
      14% { color: #ff7300; }
      28% { color: #fffb00; }
      42% { color: #48ff00; }
      57% { color: #00ffd5; }
      71% { color: #002bff; }
      85% { color: #7a00ff; }
      100% { color: #ff00c8; }
    }
    @media (max-width: 600px) {
      #loading {
        font-size: 1.8rem;
        padding: 10px;
      }
    }
        .openhome-btn {
            height: 50px;
            width: auto;
            display: inline-block;
            border: none;
            outline: none;
            color: #fff;
            background: #111;
            position: relative;
            z-index: 0;
            border-radius: 10px;
            padding: 10px 20px;
            text-align: center;
            line-height: 30px;
            font-weight: 700;
            letter-spacing: 3px;
            margin-left: auto;
            margin-right: auto;
        }
        .openhome-btn:before {
            content: '';
            background: linear-gradient(45deg, #ff0000, #ff7300, #fffb00, #48ff00, #00ffd5, #002bff, #7a00ff, #ff00c8, #ff0000);
            position: absolute;
            top: -2px;
            left: -2px;
            background-size: 400%;
            z-index: -1;
            filter: blur(5px);
            width: calc(100% + 4px);
            height: calc(100% + 4px);
            animation: glowing 20s linear infinite;
            transition: opacity .3s ease-in-out;
            border-radius: 10px;
        }
        .openhome-btn:after {
            z-index: -1;
            content: '';
            position: absolute;
            width: 100%;
            height: 100%;
            background: #111;
            left: 0;
            top: 0;
            border-radius: 10px;
        }
        .openhome-btn .glass-effect {
            position: absolute;
            width: 100%;
            height: 100%;
            top: 0;
            left: 0;
            display: block;
            overflow: hidden;
            z-index: 9;
            border-radius: 10px;
        }
        .openhome-btn .glass-effect:after {
            background: #fff;
            content: "";
            height: 155px;
            left: -75px;
            opacity: .2;
            position: absolute;
            top: -50px;
            width: 50px;
            -webkit-transition: all 550ms cubic-bezier(0.19, 1, 0.22, 1);
            transition: all 550ms cubic-bezier(0.19, 1, 0.22, 1);
            -webkit-transform: rotate(35deg);
            -ms-transform: rotate(35deg);
            transform: rotate(35deg);
            z-index: -10;
        }
        .openhome-btn:hover .glass-effect:after {
            left: 120%;
            -webkit-transition: all 550ms cubic-bezier(0.19, 1, 0.22, 1);
            transition: all 550ms cubic-bezier(0.19, 1, 0.22, 1);
        }
        #histats-container {
            display: none;
        }

        .warp-botao {
            font-size: 12px;
            font-weight: bold;
            padding: 6px 10px;
            background-color: blue;
            color: white;
            border: none;
            border-radius: 10px;
            position: fixed;
            top: 10px;
            right: 10px;
            z-index: 1;
            display: inline-block;
        }
        
        .warp-botao:hover {
            cursor: pointer;
            background-color: #000000;
            color: #FFFFFF;
            border: 1px solid #FFFFFF;
        }
        @media screen and (max-width: 400px) {
            .warp-botao {
                top: 10px;
                right: 10px;
                font-size: 3vw;
                padding: 3px 5px;
            }
        }
  </style>
